O azeite de oliva é extraído das azeitonas, fruto das oliveiras. Dá para fazer uma coleção dos benefícios já identificados que este alimento traz para saúde.

O nutriente em evidência no azeite é a gordura monoinsaturada, necessária e indispensável ao organismo para manter diversas funções dentro do corpo e é por ai que começam os grandes benefícios oferecidos por ele. Além da gordura monoinsaturada, são encontrados na composição do azeite os polifenóis que são compostos antioxidantes fortíssimos, o famoso grupo dos ômegas ou ácidos graxos essenciais (ômega 3, ômega 7, ômega 9 e ômega 6), além das vitaminas lipossolúveis (A,D, E e K), em especial a vitamina E que está em maior quantidade do que as demais. 

Todos esses nutrientes e compostos são responsáveis pelos benefícios do azeite de oliva, dando a ele uma característica medicinal única com grande efeito preventivo na saúde. Cito os mais encontrados:

Prevenção de arteriosclerose e proteção do coração;
Proteção do cérebro, previne derrames;
Prevenção do câncer;
Efeito protetor do envelhecimento da pele;
Ação nutritiva para pele, cabelos e unhas;
Ação na redução das gorduras abdominais;
Proteção da parede do estômago quanto a agressores externos;
Auxilia no bom funcionamento do pâncreas;
Melhora a saúde dos ossos.
Com tantos benefícios é impossível ficar sem ele diariamente na nossa alimentação.

Agora para que fique claro é importante compreender que tipo de azeite utilizar e que características ele deve apresentar para te oferecer tamanhos benefícios à saúde.

No mercado você irá encontrar o Azeite extra virgem, com diversos tipos de acidez, irá encontrar também o Azeite virgem, o Azeite refinado e o Azeite puro.

Qual tipo de azeite é melhor?
Para obter todos os benefícios citados acima busque sempre pelo AZEITE EXTRA VIRGEM, e fique atento ao seu grau de acidez que deve ser menor do que 0,5% (<0.5%). Este tipo de azeite é extraído após a primeira prensagem a frio, portanto é mais puro e quanto menor a acidez, maior é a pureza e a garantia dos bons componentes.

Os demais tipos de azeites são conseguidos a partir da segunda prensagem e acabam não mantendo tamanho grau de pureza e qualidade. São menos concentrados e podem não ser extraídos a frio o que compromete ainda mais a qualidade. Portanto na hora de comprar o seu azeite opte pelo EXTRA VIGEM <0,5% DE ACIDEZ.

Qual a melhor forma de utilizar o azeite extra virgem?
Sempre digo que quanto menos processar os alimentos melhor, pois eles mantêm mais a sua característica original que no caso do azeite é a mais interessante. Portanto utilizar em saladas ou por cima da comida sem aquecer é sem dúvida a melhor forma de utilização. Caso opte por cozinhar com o azeite tudo bem, mas não permita que ele atinja temperaturas muito elevadas.

Débora Sorgi – Nutricionista Funcional

